import axios from 'axios';

const GetData = () => {
  const [apiData, setApiData] = useState();
  const api = 'https://front-end-test-bvhzjr6b6a-uc.a.run.app';

  useEffect(() => {
    axios.get(api)
      .then(res => {
        console.log(res.data);
        setApiData(res.data.map((el, i) => {
          return (
            <div key = {i}>
              {el.price}
            </div>
          );
        }));

      })
  },[]);

  console.log(apiData);

  return (
   <div>
    {apiData}
   </div>
  )
};

export default GetData;
